import './App.css';
import DE2Component from "./Components/DE2Component";
import LedEditor from "./Components/LedEditor";
import Grid from "./Components/Grid";

function App() {
  return (
    <div className='App'>
      <div className='container'>
        <div className='blank'>1</div>
        <div className='blank'>2</div>
        <div className='blank'>3</div>
        <div className='blank'>4</div>
        <DE2Component/>
        <div className='blank'>6</div>
        <div className='blank'>7</div>
        <LedEditor/>
        <div className='blank'>9</div>
      </div>
    </div>
  );
}

export default App;
